import 'package:json_annotation/json_annotation.dart';part 'menu_test_model.g.dart';@JsonSerializable()class DemoModel {  DemoModel(      this.count,      this.name,      this.typeList,      );  int count;  String name;  List typeList;  //不同的类使用不同的mixin即可  factory DemoModel.fromJson(Map<String, dynamic> json) => _$DemoModelFromJson(json);  Map<String, dynamic> toJson() => _$DemoModelToJson(this);}